import React from "react";
import { useNavigate } from 'react-router-dom'
import {
  Row,
  Col,
  Card,
  Button,
  Container,
  Carousel,
  Image,
} from "react-bootstrap";
import Hero from "../components/Hero";
import Speech from "../components/Speech";
import "./Home.css";
import history from '../../components/utils/history'

const Home = () => {

  const history = useNavigate();

  const routeChange = () =>{ 
    let path = `/projects`; 
    history.push(path);
  }
  return (
    <div>
      <Hero />
      <Speech />
      <Container
        fluid
        style={{ backgroundColor: "black", justifyContent: "center", padding: "8%"}}
      >
        <Carousel >
          <Carousel.Item>
            <Image
              style={{ maxWidth: "70%" }}
              className="mx-auto d-block"
              src="../assets/weather.png"
              alt="First slide"
              rounded
            />
            <Carousel.Caption>
              <h3>Weather App</h3>
              <p>Shows you weather data based on the current location</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <Image
              style={{ maxWidth: "70%" }}
              className="mx-auto d-block"
              src="../assets/quarters.png"
              alt="Second slide"
            />

            <Carousel.Caption>
              <h3>Responsive React App</h3>
              <p>Showcases responsiveness across all screen sizes</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <Image
              style={{ maxWidth: "70%" }}
              className="mx-auto d-block"
              src="../assets/pokemon.png"
              alt="Third slide"
            />

            <Carousel.Caption>
              <h3>Pokedex</h3>
              <p>Learn Pokemon facts here</p>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>
        <Row
          gutter={[24, 24]}
          style={{ justifyContent: "center", padding: "50px" }}
        >

              <Button variant="light" style={{ margin: "auto", textAlign: "center", width: "20%"}} onClick={routeChange}>
                Check them out
              </Button>

        </Row>
      </Container>
    </div>
  );
};

export default Home;
